function Commitments() {
  return (
    <div className="Main3">
      <h2 className = "text"> Combining quality and reliability in one </h2>
      <img className = "cia" src={img1} alt="Loading!" />
      <h2> That's Handy, Harry! Stick It In The Store </h2>
      <img className = "cia2" src={img2} alt="Loading!" />
    </div>
  );
}

export default Commitments;
